import React from 'react';

function WelcomeSection() {
  return (
    <section className="welcome">
      <h1>Bienvenido a Nuestra Aplicación</h1>
      <p>Esta es una breve descripción de nuestra aplicación.</p>
    </section>
  );
}

export default WelcomeSection;
